import React from 'react';
import { Route,Switch} from "react-router-dom";
import EmployeeDash from './EmployeeDash';
import Login from "./Login";

const App= () =>{
    return(
        <>

        <Switch>
            <Route exact path='/' component={Login}/>
            <Route path='/emplyee' component={EmployeeDash}/>
        </Switch>
        {/* <Login/>
        <EmployeeDash/> */}
        </>
    );
}



export default App;
